import styles from './Image.module.scss';

const Image = () => (
  <section className={styles.ImageWrapper}>
    <h2 className={styles.Header}>Welcome to BGM Bank!</h2>
    <p className={styles.Copy}>Let's Get Started</p>
  </section>
);

export default Image;
